import React from "react";
export default function NavBar(){
    return(
        <div className="nav-container">
        <button className="all">All Post</button>
        <button className="article">Articles</button>
        <button className="event">Event</button>
        <button className="education">Education</button>
        <button className="job">Jobs</button>
        </div>
    );
}
